import React from "react";

class Header extends React.Component{
    render() {
        return(
            <header class="header" id="header">
                <div id="logo"><a href = "index.html"><h1 class="wob">WorldofBoardGames.com</h1></a></div>
                <div id="quick_link">
                <a target="_blank" href = "https://www.google.com/maps/place/Worldofboardgames.com/@63.8482097,20.3114261,15z/data=!4m2!3m1!1s0x0:0xc047bbd27173880b?sa=X&ved=2ahUKEwjF4LnVm6T9AhXL6CoKHWpSAYYQ_BJ6BAhxEAg"><i class="map"><img src="src/map.svg" alt="hitta till butiken" /></i></a>
                <a href = "login.html"><i class="knight"><img src="src/logg-in.svg" alt="logga in eller skapa konto" /></i></a>
                <a href = "URL"><i class="cart"><img src="src/cart.svg" alt="din kundvagn" /></i></a>
                <a href="#footer"><i class="down"><img src="src/down.svg" alt="button to footer" /></i></a>
                </div>
            </header>
        );
    }
}
export default Header;
